import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={HomePage}/>
      </Routes>
      </BrowserRouter>
      <p>Front End Project Using Typescript</p>
    </div>
  );
}

export default App;
